import React, { useState } from 'react';
import NavbarTop from './NavbarTop';

import badgedisabled from '../img/badgedisabled.svg';
import badgeenabled from '../img/badgeenabled.svg';
import lessonicon from '../img/lessonicon.svg';
import lessonicon2 from '../img/lessonicon2.svg';

import '../App.css';

let lessoList = [
	{ title: 'Basics training', badgeImg: badgeenabled, lessonImg: lessonicon },
	{}
];
let badgeImg = [badgedisabled, badgeenabled];
let lessonImg = [lessonicon, lessonicon2];

export default function Dashboard() {
	return (
		<article>
			<header>
				<NavbarTop />
			</header>
			<body>
				<div style={styles.container}>
					{lessonImg.map(imgLink => (
						<LessonElement lessonImg={imgLink} />
					))}
				</div>
			</body>
		</article>
	);
}

function LessonElement(props) {
	return (
		<div style={styles.container}>
			{badgeImg.map(imgLink => (
				<span>
					<img
						src={props.lessonImg}
						style={{
							height: '20vmin',
							background: '#dae1e7ff',
							borderRadius: '50%',
							padding: '20px'
						}}
					/>
					<LessonTitle badge={imgLink} />
				</span>
			))}
		</div>
	);
}

function LessonTitle(props) {
	return (
		<div style={styles.rowContainer}>
			<img
				src={props.badge}
				style={{
					height: '5vmin'
				}}
			/>
			<p
				style={{
					fontWeight: '700',
					color: 'rgb(87, 86, 92)',
					fontFamily: 'din-round, sans-serif'
				}}
			>
				Basics training
			</p>
		</div>
	);
}

const styles = {
	defaultFontFamily: {
		fontFamily: 'din-round, sans-serif'
	},
	lessonElement: {
		height: '15vmin'
	},
	container: {
		minHeight: '50vh',
		display: 'flex',
		flexDirection: 'column',
		alignItems: 'center',
		justifyContent: 'center',
		fontSize: 'calc(10px + 2vmin)'
	},
	rowContainer: {
		height: '100%',
		display: 'flex',
		flexDirection: 'row',
		alignItems: 'top',
		justifyContent: 'center'
	}
};
// export default Dashboard;
